// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.9;

/*
 * @title PollData
 * @author Idris Abdul-Lateef (@eedrxs)
 * @dev Contains a series of custom data types used in the "PollFactory" and "Poll" contracts. It is to be inherited.
 */

contract PollData {
    struct Option {
        // Represents each option in a category.
        uint8 id; // Holds the option's ID in its category
        uint32 votes; // Holds the number of votes the option gets
        string text; // Holds the text content
    }

    struct Category {
        // Represents each category in a poll.
        uint8 id; // Hold's the category's ID
        string text; // Holds the text content
        Option[] options; // Holds list of the options for the category
    }

    struct Option_ {
        // Same of the Option struct but without the "votes" variable. It is used to hold
        // the data supplied to the "createPoll" function of the PollFactory contract
        uint8 id;
        string text;
    }

    struct Category_ {
        // Same as the Category struct but modified to hold the Option_ struct instead
        uint8 id;
        string text;
        Option_[] options;
    }

    struct Participants {
        // Represents the eligible participants in a poll
        address[] list; // An array of account addresses eligible for the poll.
        mapping(address => bool) eligibility; // A mapping that shows the eligibility of an address for the poll.
        // Each address in "address[] list" is mapped to true
    }

    struct QueryResult {
        // Represents the data returned from querying a poll
        string[] titleDesc; // [Title, Description] of the poll
        uint256[] startEnd; // [StartTime, EndTime] of the poll
        uint256 creationTime; // Time poll was created
        PollStatus pollStatus; // Current status of the poll
        uint256 votes; // Total number of votes at the time of querying
        bool isOpen; // Bool that shows if poll is an open or closed poll
        bool isEligible; // Bool that shows if the account querying is eligible to participate
        uint256 pollId; // ID of the poll
    }

    enum PollStatus {
        Upcoming,
        Ongoing,
        Ended
    }
}

contracts/PollFactory.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.9;
pragma experimental ABIEncoderV2;

import "./Poll.sol";
import "./PollData.sol";
import "./utils/Counters.sol";

contract PollFactory is PollData {
    using Counters for Counters.Counter;
    Counters.Counter private _pollId;

    mapping(uint256 => Poll) private _polls;
    event pollCreated(uint256 indexed pollCount);

    function createPoll(
        string[] memory titleDesc_,
        uint256[] memory startEnd_,
        Category_[] memory categories_,
        address[] memory participation_
    ) external {
        _pollId.increment();
        _polls[_pollId.current()] = new Poll(
            _pollId.current(),
            titleDesc_,
            startEnd_,
            categories_,
            participation_
        );
        emit pollCreated(_pollId.current());
    }

    function queryPoll(uint256 pollId)
        public
        view
        returns (QueryResult memory)
    {
        require(pollId <= _pollId.current(), "Poll doesn't exist!");
        (
            string[] memory titleDesc,
            uint256[] memory startEnd,
            uint256 creationTime,
            uint256 votes,
            bool isOpen,
            uint256 pollId_
        ) = _polls[pollId].getPollDetails();
        bool callerIsEligible = _polls[pollId].isEligible(msg.sender);
        PollStatus _pollStatus = pollStatus(startEnd);
        return
            QueryResult(
                titleDesc,
                startEnd,
                creationTime,
                _pollStatus,
                votes,
                isOpen,
                callerIsEligible,
                pollId_
            );
    }

    function fetchPolls(uint256 pollId, uint8 n)
        external
        view
        returns (QueryResult[] memory)
    {
        QueryResult[] memory queryResults = new QueryResult[](n);
        for (uint256 i; i < n; i++) {
            queryResults[i] = queryPoll(pollId - i);
        }
        return queryResults;
    }

    function getPollCount() external view returns (uint256) {
        return _pollId.current();
    }

    function getPollAddress(uint256 pollId) external view returns (address) {
        require(
            _polls[pollId].isEligible(msg.sender) ||
                msg.sender == _polls[pollId].owner(),
            "You're not eligible for this poll!"
        );
        return address(_polls[pollId]);
    }

    function pollStatus(uint256[] memory _startEnd)
        public
        view
        returns (PollStatus)
    {
        if (_startEnd.length == 0) return PollStatus.Ongoing;
        else if (block.timestamp < _startEnd[0]) return PollStatus.Upcoming;
        else if (
            block.timestamp > _startEnd[0] && block.timestamp < _startEnd[1]
        ) return PollStatus.Ongoing;
        else return PollStatus.Ended;
    }

    function currentTime() public view returns (uint256) {
        return block.timestamp;
    }
}

